De mooie freelance geheim agente Mallory Kane wordt door verschillende globale organisaties gevraagd om klussen uit te voeren die regeringen niet zelf kunnen en mogen goedkeuren. Na een gijzelaar bevrijd te hebben in Barcelona, wordt Mallory snel op een missie gestuurd in Dublin. Als die missie fout gaat ontdekt ze dat ze bedrogen is en moet ze al haar vaardigheden, trucs en mogelijkheden aanwenden om een internationale klopjacht te ontlopen, en terug te keren naar Amerika.


